    playbackData.comments = {"caa77d89-2106-48d0-8b4e-58869403af99":[{"id":"1f58fa83-0e35-4209-afe9-aead456cf1b3","displayCommentEventId":"caa77d89-2106-48d0-8b4e-58869403af99","displayCommentEventSequenceNumber":0,"developerGroupId":"032f8909-3e8b-4131-a04c-04159fc3dc2b","timestamp":1695143411741,"commentText":"A playback discussing the different types of loops.&nbsp; We create an average quiz score calculator to introduce both for and while loops.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"59a0f023-b513-4b2e-ba24-c0d000ff6075":[{"id":"b184534d-d43c-4d3e-885e-8c6f240dc584","displayCommentEventId":"59a0f023-b513-4b2e-ba24-c0d000ff6075","displayCommentEventSequenceNumber":74,"developerGroupId":"c1692f1e-2aa4-4c5b-ae26-897ba9fcb167","timestamp":1695144029332,"commentText":"Begin with our basic shell of a program.","commentTitle":"","position":0,"selectedCodeBlocks":[],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"","commentTags":[],"questionCommentData":null}],"fb3f319d-516a-4c68-8831-a2aef05ad63c":[{"id":"582b7fef-8b67-4ca2-abf0-7fea118ebd15","displayCommentEventId":"fb3f319d-516a-4c68-8831-a2aef05ad63c","displayCommentEventSequenceNumber":193,"developerGroupId":"c1692f1e-2aa4-4c5b-ae26-897ba9fcb167","timestamp":1695144214916,"commentText":"Next, create variables to hold both a running average of quiz score grades and the current grade being entered by the user.&nbsp;&nbsp;<div><br></div><div>We assign an initial value of 0 to average since we will be adding to this value as our program progresses, and it is important to make sure we don't have any other value stored in average that could accidentally alter our calculations.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"7912cd93-9825-4941-8245-47a03ecfd891","selectedText":"    double average,grade;\n    average = 0;","startRow":7,"startColumn":0,"endRow":8,"endColumn":16}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":7,"linesBelow":3,"currentFilePath":"/main.cpp","viewableBlogText":"#include <iostream>\n\nusing namespace std;\n\nint main()\n{\n    //Create a program to average 5 quiz scores (in the range of 0 to 100)\n    double average,grade;\n    average = 0;\n\n    return 0;\n}","commentTags":[],"questionCommentData":null}],"9545ca19-cbf3-4136-9889-22d4814052ba":[{"id":"58b17e5f-0ee7-42fd-aa70-3ef3c7727ae2","displayCommentEventId":"9545ca19-cbf3-4136-9889-22d4814052ba","displayCommentEventSequenceNumber":254,"developerGroupId":"c1692f1e-2aa4-4c5b-ae26-897ba9fcb167","timestamp":1695176032663,"commentText":"This code is the basic shell of a <span style=\"font-style: italic;\">for loop</span>, a mechanism for repeating code a certain number of times (in this example, 5 times).&nbsp; The video below describes looping and discusses in detail the flow of control for a loop and the syntax of a for loop.","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"7912cd93-9825-4941-8245-47a03ecfd891","selectedText":"  for (int i = 0; i < 5; i++)\n    {\n        \n    }","startRow":10,"startColumn":2,"endRow":13,"endColumn":5}],"imageURLs":[],"videoURLs":["media/videos/1695176027907-For-Loop-Syntax.mp4"],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"    for (int i = 0; i < 5; i++)\n    {\n        \n    }","commentTags":["video"],"questionCommentData":null}],"d0a07c1b-1a03-47ed-a688-374435d22784":[{"id":"2ec6c984-130d-4545-8b80-ec69221616d3","displayCommentEventId":"d0a07c1b-1a03-47ed-a688-374435d22784","displayCommentEventSequenceNumber":343,"developerGroupId":"c1692f1e-2aa4-4c5b-ae26-897ba9fcb167","timestamp":1695176427554,"commentText":"For reasons we will see soon, it is common programming practice to count from 0, not from 1 (i.e. the initial value we assigned to the variable <span style=\"font-style: italic;\">i </span>was 0, not 1).&nbsp; Because a person would reference the first quiz as \"Quiz 1\" and not \"Quiz 0\", we display to the console the value <span style=\"font-style: italic;\">i </span>+ 1, not<span style=\"font-style: italic;\"> i</span>.&nbsp; Notice that we have only printed <span style=\"font-style: italic;\">i</span> + 1, not reassigned a value of<span style=\"font-style: italic;\"> i</span> + 1 to <span style=\"font-style: italic;\">i, </span>so this line of code does <span style=\"font-weight: bold;\">not</span> change the value of <span style=\"font-style: italic;\">i.</span>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"7912cd93-9825-4941-8245-47a03ecfd891","selectedText":"    cout << \"Please enter your grade (0-100) on quiz \" << i+1 << \":\";","startRow":12,"startColumn":4,"endRow":12,"endColumn":73}],"imageURLs":["media/images/1695176416308-countFromZero.png"],"videoURLs":[],"audioURLs":[],"linesAbove":2,"linesBelow":1,"currentFilePath":"/main.cpp","viewableBlogText":"    for (int i = 0; i < 5; i++)\n    {\n        cout << \"Please enter your grade (0-100) on quiz \" << i+1 << \":\";\n    }","commentTags":["image"],"questionCommentData":null}],"3af9c3fd-075b-4a32-add6-3e276d736ac3":[{"id":"65c6a4c8-237f-4879-901e-3da85bcc15a5","displayCommentEventId":"3af9c3fd-075b-4a32-add6-3e276d736ac3","displayCommentEventSequenceNumber":459,"developerGroupId":"c1692f1e-2aa4-4c5b-ae26-897ba9fcb167","timestamp":1695178567846,"commentText":"Our program expects that a grade will fall between values of 0 and 100, inclusive.&nbsp; If a user enters an incorrect grade, we wish to tell them of their mistake and allow them to try again.&nbsp; Moreover, we wish to do this process (tell the user of their mistake and allow them to re-enter data) until they enter acceptable data.<div><br></div><div>To repeat a block of code for as long as necessary until a condition is satisfied, we use a <span style=\"font-style: italic;\">while loop</span>.&nbsp; The syntax of a while loop, along with its use case and a warning, is discussed in the video below.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"7912cd93-9825-4941-8245-47a03ecfd891","selectedText":"     while (grade < 0 || grade > 100)\n        {\n            \n        }","startRow":14,"startColumn":3,"endRow":17,"endColumn":9}],"imageURLs":[],"videoURLs":["media/videos/1695178532845-While-Loops.mp4"],"audioURLs":[],"linesAbove":2,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"        cout << \"Please enter your grade (0-100) on quiz \" << i+1 << \":\";\n        cin >> grade;\n        while (grade < 0 || grade > 100)\n        {\n            \n        }","commentTags":["video"],"questionCommentData":null}],"8de5bf62-fa46-4268-960d-c03d7c60c941":[{"id":"84d9c158-f5d7-4bfd-9f9d-1dcc172eb608","displayCommentEventId":"8de5bf62-fa46-4268-960d-c03d7c60c941","displayCommentEventSequenceNumber":701,"developerGroupId":"c1692f1e-2aa4-4c5b-ae26-897ba9fcb167","timestamp":1695178818176,"commentText":"This while loop is validating user input.&nbsp; When a user makes a mistake, it is good programming practice to describe the nature of their mistake.&nbsp;&nbsp;<div><br></div><div>Line 18 then re-prompts the user to enter the data in the proper format, while line 19 takes in the new value to be reassigned to the grade variable.</div><div><br></div><div>Note that reassigning a value to the grade variable allows the <span style=\"font-style: italic;\">exit condition</span> in line 15 (the boolean expression between parentheses) to potentially change.&nbsp; This condition is re-evaluated for its truth after the block of code in lines 16-19 is executed.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"7912cd93-9825-4941-8245-47a03ecfd891","selectedText":"    while (grade < 0 || grade > 100)\n        {\n            cout << \"I'm sorry, grades must be between 0 and 100.\" << endl;\n            cout << \"Please enter your grade (0-100) on quiz \" << i+1 << \":\";\n            cin >> grade;\n        }","startRow":14,"startColumn":4,"endRow":19,"endColumn":9}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":0,"linesBelow":0,"currentFilePath":"/main.cpp","viewableBlogText":"        while (grade < 0 || grade > 100)\n        {\n            cout << \"I'm sorry, grades must be between 0 and 100.\" << endl;\n            cout << \"Please enter your grade (0-100) on quiz \" << i+1 << \":\";\n            cin >> grade;\n        }","commentTags":[],"questionCommentData":null}],"d449a94c-5e2a-4bd6-8815-7bbc4b8fc8fd":[{"id":"69e8f006-28bf-4dfb-93d7-0bf2588ba0ed","displayCommentEventId":"d449a94c-5e2a-4bd6-8815-7bbc4b8fc8fd","displayCommentEventSequenceNumber":728,"developerGroupId":"c1692f1e-2aa4-4c5b-ae26-897ba9fcb167","timestamp":1695179353276,"commentText":"Once the user has entered an acceptable value (between 0 and 100) for a grade on the <span style=\"font-style: italic;\">i</span>th&nbsp;quiz, the boolean expression in line 15 will evaluate to false and the flow of control will resume in line 21.<div><br></div><div>Following line 21 is the closing brace for the block of code associated with the for loop that begins on line 11.&nbsp; This means that after line 21 is executed, the variable<span style=\"font-style: italic;\"> i</span> will be incremented, and the very next step taken by the computer will be to re-evaluate the boolean condition \"<span style=\"font-style: italic;\">i</span> &lt; 5\" from line 11.</div><div><br></div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"7912cd93-9825-4941-8245-47a03ecfd891","selectedText":"     average += grade;","startRow":20,"startColumn":3,"endRow":20,"endColumn":25}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":10,"linesBelow":1,"currentFilePath":"/main.cpp","viewableBlogText":"    for (int i = 0; i < 5; i++)\n    {\n        cout << \"Please enter your grade (0-100) on quiz \" << i+1 << \":\";\n        cin >> grade;\n        while (grade < 0 || grade > 100)\n        {\n            cout << \"I'm sorry, grades must be between 0 and 100.\" << endl;\n            cout << \"Please enter your grade (0-100) on quiz \" << i+1 << \":\";\n            cin >> grade;\n        }\n        average += grade;\n    }","commentTags":[],"questionCommentData":null}],"d45723fd-e675-46ab-851a-607c7470e470":[{"id":"f2ba8c70-7240-48aa-b2a3-190212bf7705","displayCommentEventId":"d45723fd-e675-46ab-851a-607c7470e470","displayCommentEventSequenceNumber":858,"developerGroupId":"c1692f1e-2aa4-4c5b-ae26-897ba9fcb167","timestamp":1695218570602,"commentText":"Throughout the whole looping process, average adds together the grades that have been input by the user.&nbsp; Because we do not add in the grade until the flow of control exits the while loop, we only total together the <span style=\"font-style: italic;\">good</span> user input.&nbsp; In line 24, we must divide that total by the number of (correct) quiz scores entered.&nbsp; Line 25 simply displays the computed average to the screen.<div><br></div><div><div>One of the images below shows the console interaction with this code.&nbsp; Note that we are given three opportunities to enter a reasonable grade for quiz 3: once after entering a negative number and once after entering a value above 100.&nbsp; In the end, our quiz average computation only took into account the five values of 100 that were proper grade entries.<br></div><div><br></div><div>The second visual shows a flowchart of our program.</div></div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"7912cd93-9825-4941-8245-47a03ecfd891","selectedText":"    average = average / 5.0;\n    cout << \"Your average grade on quizzes is \" << average << endl;","startRow":23,"startColumn":0,"endRow":24,"endColumn":67}],"imageURLs":["media/images/1695218553964-GradesFlowchart.png","media/images/1695250862266-gradeCode.PNG"],"videoURLs":[],"audioURLs":[],"linesAbove":13,"linesBelow":3,"currentFilePath":"/main.cpp","viewableBlogText":"    for (int i = 0; i < 5; i++)\n    {\n        cout << \"Please enter your grade (0-100) on quiz \" << i+1 << \":\";\n        cin >> grade;\n        while (grade < 0 || grade > 100)\n        {\n            cout << \"I'm sorry, grades must be between 0 and 100.\" << endl;\n            cout << \"Please enter your grade (0-100) on quiz \" << i+1 << \":\";\n            cin >> grade;\n        }\n        average += grade;\n    }\n\n    average = average / 5.0;\n    cout << \"Your average grade on quizzes is \" << average << endl;\n\n    return 0;\n}","commentTags":["image"],"questionCommentData":null}],"349e8be4-0471-4b73-b6ab-4a4df166d1e3":[{"id":"e993e98f-8639-4940-9c70-dcc8107b7f97","displayCommentEventId":"349e8be4-0471-4b73-b6ab-4a4df166d1e3","displayCommentEventSequenceNumber":931,"developerGroupId":"c1692f1e-2aa4-4c5b-ae26-897ba9fcb167","timestamp":1695250439832,"commentText":"Best programming practice is to:<div><br><div>1. Not use \"magic numbers\"</div><div>2. Make your programs as generalizable as possible</div></div><div><br></div><div>In order to accomplish these points, I've changed the 5 that was hard coded into the program to a global constant NUM_QUIZZES in line 4.&nbsp; This value can be set by the programmer in line 4 and then the value set by the programmer will be implement in lines 12 and 25 automatically.&nbsp;&nbsp;</div><div><br></div><div>Because average is a double and NUM_QUIZZES is an int and we wish for division of doubles to occur in line 25, we explicitly cast NUM_QUIZZES as a double to perform the average computation.</div>","commentTitle":"","position":0,"selectedCodeBlocks":[{"fileId":"7912cd93-9825-4941-8245-47a03ecfd891","selectedText":"const int NUM_QUIZZES = 5;","startRow":3,"startColumn":0,"endRow":3,"endColumn":26}],"imageURLs":[],"videoURLs":[],"audioURLs":[],"linesAbove":3,"linesBelow":21,"currentFilePath":"/main.cpp","viewableBlogText":"#include <iostream>\n\nusing namespace std;\nconst int NUM_QUIZZES = 5;\n\nint main()\n{\n    //Create a program to average 5 quiz scores (in the range of 0 to 100)\n    double average,grade;\n    average = 0;\n\n    for (int i = 0; i < NUM_QUIZZES; i++)\n    {\n        cout << \"Please enter your grade (0-100) on quiz \" << i+1 << \":\";\n        cin >> grade;\n        while (grade < 0 || grade > 100)\n        {\n            cout << \"I'm sorry, grades must be between 0 and 100.\" << endl;\n            cout << \"Please enter your grade (0-100) on quiz \" << i+1 << \":\";\n            cin >> grade;\n        }\n        average += grade;\n    }\n\n    average = average / double(NUM_QUIZZES);","commentTags":[],"questionCommentData":null}]};
